							case 4:
								locy = Lang13.IntNullable( mobloc.y );
								locx = Lang13.IntNullable( mobloc.x + 2 );

								if ( ( locx ??0) > Game13.map_size_x ) {
									return false;
								}
								break;
							case 8:
								locy = Lang13.IntNullable( mobloc.y );
								locx = Lang13.IntNullable( mobloc.x - 2 );

								if ( ( locx ??0) < 1 ) {
									return false;
								}
