			}
			max_range = Num13.MaxInt( Convert.ToInt32( devastation_range ), Convert.ToInt32( heavy_impact_range ), Convert.ToInt32( light_impact_range ) );
			x0 = Convert.ToInt32( epicenter.x );
			y0 = Convert.ToInt32( epicenter.y );
