			isinvuln = false;

			if ( Lang13.Bool( M.flags & 128 ) ) {
				isinvuln = true;
			}

			switch ((bool)( isinvuln )) {
				case false:
					
					if ( Interface13.Alert( Task13.User, "Make the target atom invulnerable to all form of damage?", "Toggle Invulnerability", "Yes", "No" ) != "Yes" ) {
						return;
					}
					M.flags |= 128;
