			if ( !Lang13.Bool( msg ) ) {
				msg = Interface13.Input( this, "Message:", "Private message to " + GlobalFuncs.key_name( C, 0, false ), "", null, InputType.Str | InputType.Null );

				if ( !Lang13.Bool( msg ) ) {
					return;
