					} else {
						this.adminhelp( msg );
					}
					return;
				}
			}

			if ( this.handle_spam_prevention( msg, 8 ) ) {
				return;
			}

			if ( !GlobalFuncs.check_rights( 48, false ) ) {
				msg = GlobalFuncs.sanitize( String13.SubStr( msg, 1, 1024 ) );

				if ( !Lang13.Bool( msg ) ) {
					return;
				}
			}
